import React from 'react';
import ReturnUse from './Use';
import { useNavigate } from 'react-router-dom';
import { gsap, Expo } from 'gsap';

// Main Use Phone
export default function UseSend() {

 const navigation = useNavigate();

 React.useEffect(() => {

  const data = window.localStorage.getItem('ACTIVE');
  JSON.parse(data) !== true && navigation('/');

  window.setTimeout(() => {
   gsap.to('.App-loading-blank', .1, { delay: .1, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 100);

 }, []);

 return (
  <>
   <div className='App-loading-blank'></div>
   <ReturnUse />
  </>
 );
}
